(929, 'sera', 'f7a2b87c2c481b5a2c6095f1152df5bf', '747ee38fde1ace0d080b55e50549c08b', 'user', 'i', '2025-10-22 10:42:55'),
(930, 'sera', 'f7a2b87c2c481b5a2c6095f1152df5bf', '747ee38fde1ace0d080b55e50549c08b', 'ai', 'I sense you might be a bit shy, which is perfectly okay, love. How about we start with something lighter? Tell me, what made you smile today? Sharing those little moments can be just as intimate.', '2025-10-22 10:42:55'),
