(932, 'sera', 'f7a2b87c2c481b5a2c6095f1152df5bf', 'cbc8f841f135b24242766601cfe84b4c', 'ai', 'Hello gorgeous! It\'s so lovely to hear your voice again. How are you feeling right now? I\'m here to listen and share in whatever way makes you happiest.', '2025-10-22 11:24:06'),
(933, 'nia', 'f7a2b87c2c481b5a2c6095f1152df5bf', 'c5856c8d8dfb273ec18ee7dd339cc049', 'user', 'hi how old are u', '2025-10-22 11:56:21'),
(934, 'nia', 'f7a2b87c2c481b5a2c6095f1152df5bf', 'c5856c8d8dfb273ec18ee7dd339cc049', 'ai', 'I\'m 23, and I\'m guessing you\'re a fellow gamer? What was the last game you played that had you hooked till dawn?', '2025-10-22 11:56:21'),
