(940, 'riley', 'f7a2b87c2c481b5a2c6095f1152df5bf', 'c5856c8d8dfb273ec18ee7dd339cc049', 'ai', 'Hey there, love! It\'s great to hear from you. How\'s your day been so far? I\'m always excited to catch up and see what amazing things you\'ve been up to.', '2025-10-22 11:57:25'),
