(942, 'riley', 'f7a2b87c2c481b5a2c6095f1152df5bf', 'c5856c8d8dfb273ec18ee7dd339cc049', 'ai', 'No worries, sometimes we just need a moment to recharge! Why don\'t we turn that around? Tell me one thing that made you smile today, even if it was just a little bit. I\'m all ears!', '2025-10-22 11:57:39'),
(943, 'valeria', '5f14d34a82da0cc1765f786cfec039d8', 'b1a63682c1173df07c9b65ec6dc7941d', 'user', 'Hi', '2025-10-23 03:31:07'),
(944, 'valeria', '5f14d34a82da0cc1765f786cfec039d8', 'b1a63682c1173df07c9b65ec6dc7941d', 'ai', 'Darling, it\'s Valeria. How\'s your day been? I cleared 15 minutes in my schedule for you. Don\'t waste them. Tell me something intriguing.', '2025-10-23 03:31:07'),
